('b849fb80-6bfe-11ea-99e9-48f17f8d4d88', '', '', '9ed61045-6bb0-11ea-859b-48f17f8d4d88', NULL, 'Bugatti Divo', '<p><u class=\"ql-size-large\">Bugatti Divo</u></p><p><span style=\"color: rgb(34, 34, 34);\">system featuring quad exhaust pipes, a 1.8 metre wide fixed rear wing (23% wider than the retractable wing on the&nbsp;</span><a href=\"https://en.wikipedia.org/wiki/Bugatti_Chiron\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(11, 0, 128);\">Chiron</a><span style=\"color: rgb(34, 34, 34);\">), a&nbsp;</span><a href=\"https://en.wikipedia.org/wiki/NACA_duct\" rel=\"noopener noreferrer\" target=\"_blank\" class=\"ql-size-small\" style=\"color: rgb(11, 0, 128);\">NACA duct</a><span class=\"ql-size-small\" style=\"color: rgb(34, 34, 34);\">&nbsp;</span><span style=\"color: rgb(34, 34, 34);\">on the roof that channels air to the rear of the car on a central fin and ultimately on the rear wing for improved downforce, a large front chin spoiler, more refined side skirts, larger air intakes on the front, new head lamps and tail lamps, a vent in the bonnet for improved radiator cooling and vents on the front wheel arches to cool the </span><strong style=\"color: rgb(34, 34, 34);\"><em><u>brakes</u></em></strong><span style=\"color: rgb(34, 34, 34);\">.</span></p><p><strong style=\"color: rgb(34, 34, 34);\"><em><u>Check this out here: </u></em></strong><a href=\"https://www.youtube.com/watch?v=PwxPLKVne2s\" rel=\"noopener noreferrer\" target=\"_blank\"><strong><em><u>https://www.youtube.com/watch?v=PwxPLKVne2s</u></em></strong></a></p>', '7500000', '0', '', '', 1, NULL, 99, 0, '2020-03-22 07:33:54', '9edac65d-6bb0-11ea-859b-48f17f8d4d88', '2020-04-10 07:33:32', '9edac65d-6bb0-11ea-859b-48f17f8d4d88', 1),
